import { StrictMode } from "react";
import ReactDOM from "react-dom";
import stopwatch from './stopwatch';

const rootElement = "";

if (typeof window !== 'undefined') {
	rootElement = document.getElementById("root");
}

ReactDOM.render(
  <StrictMode>
    <stopwatch />
  </StrictMode>,
  rootElement
);
